insert into product VALUES(7,'101203','에어/동결','[2022.09.03] 보스독 로우 다이어트 피쉬 레시피 340.19g',32000,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%5B2022.09.03%5D%20%EB%B3%B4%EC%8A%A4%EB%8F%85%20%EB%A1%9C%EC%9A%B0%20%EB%8B%A4%EC%9D%B4%EC%96%B4%ED%8A%B8%20%ED%94%BC%EC%89%AC%20%EB%A0%88%EC%8B%9C%ED%94%BC%20340.19g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%5B2022.09.03%5D%20%EB%B3%B4%EC%8A%A4%EB%8F%85%20%EB%A1%9C%EC%9A%B0%20%EB%8B%A4%EC%9D%B4%EC%96%B4%ED%8A%B8%20%ED%94%BC%EC%89%AC%20%EB%A0%88%EC%8B%9C%ED%94%BC%20340.19g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%5B2022.09.03%5D%20%EB%B3%B4%EC%8A%A4%EB%8F%85%20%EB%A1%9C%EC%9A%B0%20%EB%8B%A4%EC%9D%B4%EC%96%B4%ED%8A%B8%20%ED%94%BC%EC%89%AC%20%EB%A0%88%EC%8B%9C%ED%94%BC%20340.19g.jpg',"보스독 로우 다이어트 치킨 레시피는 완전하고 균형잡힌 동결건조 사료입니다. 동결건조된 생선 단백질을, 야채와 채소로 그 외 영양소를 채워 보스독 하나로 건강한 식사가 가능하며, 장 건강에 탁월한 5백만마리 이상의 프로바이오틱스가 함유되어 있습니다. 또한, 반려견의 소화 기능 및 뼈 건강 강화에 도움을 주며, 밀, 콩, 옥수수 등이 첨가되어 있지 않은 Non-GMO 사료입니다. 직사광선이나 해충이 있는 곳을 피하여 서늘하고 건조한 곳에 보관해주시고, 개봉 후 가급적 빨리 급여해주시길 바랍니다.
