insert into product VALUES(31,'101201','건식','[한정수량 100세트] 아카나 프리런 덕 2kg x 2개 + 캠핑의자 + 사료소분통 + 프레이리 폴트리 독 340g 증정',66000,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%94%84%EB%A6%AC%EB%9F%B0%20%EB%8D%95%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%94%84%EB%A6%AC%EB%9F%B0%20%EB%8D%95%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%94%84%EB%A6%AC%EB%9F%B0%20%EB%8D%95%202kg.jpg',"<선착순 100세트 한정 세트>는 아카나 프리런 덕 2kg x 2개 + 캠핑의자 + 사료소분통 + 아카나 프레이리 폴트리 독 340g으로 구성되어있습니다. 아카나 프리런 덕은 단일 단백질 함유로 음식 과민증 및 알레르기에 도움을 주는 사료로 모든 연령의 반려견에게 급여가 가능하며, 아카나 클래식 프레이리 폴트리 독은 풍부한 식이섬유로 지속적인 에너지를 생성하는 맞춤 사료입니다. 또한, 캠핑의자와 사료를 소분하여 보관이 가능한 사료소분통이있습니다. 사료 보관시 서늘하고 건조한 곳에 보관해주시기를 바랍니다.
