insert into product VALUES(271,'101201','건식','마이펫닥터 시그니처 오가닉 스킨컨트롤 2kg',23830,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%8B%9C%EA%B7%B8%EB%8B%88%EC%B2%98%20%EC%98%A4%EA%B0%80%EB%8B%89%20%EC%8A%A4%ED%82%A8%EC%BB%A8%ED%8A%B8%EB%A1%A4%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%8B%9C%EA%B7%B8%EB%8B%88%EC%B2%98%20%EC%98%A4%EA%B0%80%EB%8B%89%20%EC%8A%A4%ED%82%A8%EC%BB%A8%ED%8A%B8%EB%A1%A4%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%8B%9C%EA%B7%B8%EB%8B%88%EC%B2%98%20%EC%98%A4%EA%B0%80%EB%8B%89%20%EC%8A%A4%ED%82%A8%EC%BB%A8%ED%8A%B8%EB%A1%A4%202kg.jpg',"마이펫닥터 시그니처 오가닉 스킨컨트롤은 신선한 아스타잔틴 오리고기를 그대로 갈아 넣어 만든 사료입니다. 강력한 항산화 기능으로 활성산소 제거에 도움이 되며, 식이알레르기 억제와 피부 및 코트의 윤활 작용에 도움을 줍니다. 오메가 성분인 EPA/DHA 함유량 및 필수 아미노산과 천연 향균 물질의 함유량까지 모두 기재되어있어 보다 더 정확하고 확실한 정보를 제공하며, 알레르기를 유발 시키는 유전자 변형 물질, 유해물질은 첨가 하지 않았습니다. 또한, 중금속, 잔류농약 검사 등 원료 안정성 검사를 마쳤으며 청결한 환경에서 제조되어 안심하고 급여 하실 수 있습니다. 본 상품은 산패방지와 편리한 보관을 위해 내부 낱개 소포장을 적용하여 눅눅해지는 것을 방지하고 매일 신선한 사료를 급여 할 수 있도록 만들어졌습니다.
insert into product VALUES(272,'101201','건식','마이펫닥터 시그니처 오가닉 슬림컨트롤 2kg',28000,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%8B%9C%EA%B7%B8%EB%8B%88%EC%B2%98%20%EC%98%A4%EA%B0%80%EB%8B%89%20%EC%8A%AC%EB%A6%BC%EC%BB%A8%ED%8A%B8%EB%A1%A4%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%8B%9C%EA%B7%B8%EB%8B%88%EC%B2%98%20%EC%98%A4%EA%B0%80%EB%8B%89%20%EC%8A%AC%EB%A6%BC%EC%BB%A8%ED%8A%B8%EB%A1%A4%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%8B%9C%EA%B7%B8%EB%8B%88%EC%B2%98%20%EC%98%A4%EA%B0%80%EB%8B%89%20%EC%8A%AC%EB%A6%BC%EC%BB%A8%ED%8A%B8%EB%A1%A4%202kg.jpg',"마이펫닥터 시그니처 오가닉 슬림컨트롤은 가수분해 오리고기를 사용한 다이어트 사료입니다. 강력한 항산화 기능으로 활성산소 제거에 도움이 된느 신선한 아스타잔틴 오리고기를 그대로 갈아넣어 식이알레르기 억제와 피부의 윤활작용에 도움이 되며, 활동량이 적은 과체중 견을 위해 낮은 지방 함량과 저칼로리식으로 만들어졌습니다. 또한, 균형잡힌 영양식단을 위해 비타민과 무기질 공급을 했으며, 유전자 변형물질과 유해물질을 제외시켰습니다. 본 상품은 산패방지와 편리한 보관을 위해 내부 낱개 소포장을 적용하여 눅눅해지는 것을 방지하고 매일 신선한 사료를 급여할 수 있도록 만들어졌습니다.
insert into product VALUES(273,'101201','건식','마이펫닥터 인섹트 더 제로 1kg',22500,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%9D%B8%EC%84%B9%ED%8A%B8%20%EB%8D%94%20%EC%A0%9C%EB%A1%9C%201kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%9D%B8%EC%84%B9%ED%8A%B8%20%EB%8D%94%20%EC%A0%9C%EB%A1%9C%201kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EB%A7%88%EC%9D%B4%ED%8E%AB%EB%8B%A5%ED%84%B0%20%EC%9D%B8%EC%84%B9%ED%8A%B8%20%EB%8D%94%20%EC%A0%9C%EB%A1%9C%201kg.jpg',"마이펫닥터 인섹트 더 제로는 단일 동물성 단백질 원료인 동애등에로 만든 사료입니다. 천연 항생제 역할을 하여 알레르기 개선에 도움이 되며, 활성 산소를 중화시켜 노화방지와 염증 억제에 도움을 주는 비타민E와 오메가3,6이 함유되었습니다. 또한, 풍부한 라우르산 함유로 면역력을 증강시켜주며 질병 저항력 향상에 도움을 줍니다. 본 상품은 산패방지와 편리한 보관을 위해 내부 낱개 소포장을 적용하여 눅눅해지는 것을 방지하고 매일 신선한 사료를 급여 할 수 있도록 만들어졌습니다.
