insert into product VALUES(291,'101204','소프트','베기도그 그레인프리 2.1kg',39000,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EB%B2%A0%EA%B8%B0%EB%8F%84%EA%B7%B8%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%202.1kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EB%B2%A0%EA%B8%B0%EB%8F%84%EA%B7%B8%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%202.1kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EB%B2%A0%EA%B8%B0%EB%8F%84%EA%B7%B8%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%202.1kg.jpg',"베기도그 그레인프리는 육류 단백질이 없는 환경 친화적 사료입니다. 곡물 무첨가로 알레르기 걱정없이 급여하실 수 있으며, 감자, 완두콩, 해바라기오일, 블루베리, 치커리 뿌리가 함유되었습니다. 풍부한 비타민과 미네랄이 함유되어 신체 에너지 생성, 피부 모질 개선, 뼈 건강에 도움을 주며, 사료 알갱이가 커서 반려견들이 삼키지 않고 잘 씹으면서 스트레스 해소와 치아 건강에 도움을 줍니다. 또한, 국제 영양사양에 따라 영양사와 함께 설계되어 안심하고 급여하실 수 있습니다. 직사광선을 피하고 서늘한 곳에 보관하는 것을 권장드리며, 개봉 후에는 가급적 빠른 시일 내에 급여해주시기 바랍니다.
insert into product VALUES(292,'101202','화식/습식','베러펫 개똑 습식사료 닭고기 70g',2000,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EB%B2%A0%EB%9F%AC%ED%8E%AB%20%EA%B0%9C%EB%98%91%20%EC%8A%B5%EC%8B%9D%EC%82%AC%EB%A3%8C%20%EB%8B%AD%EA%B3%A0%EA%B8%B0%2070g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EB%B2%A0%EB%9F%AC%ED%8E%AB%20%EA%B0%9C%EB%98%91%20%EC%8A%B5%EC%8B%9D%EC%82%AC%EB%A3%8C%20%EB%8B%AD%EA%B3%A0%EA%B8%B0%2070g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EB%B2%A0%EB%9F%AC%ED%8E%AB%20%EA%B0%9C%EB%98%91%20%EC%8A%B5%EC%8B%9D%EC%82%AC%EB%A3%8C%20%EB%8B%AD%EA%B3%A0%EA%B8%B0%2070g.jpg',"베러펫 개똑 습식사료 닭고기 70g은 반려동물 인지기능 개선 첨가물이 첨가된 습식사료입니다. 반려동물의 건강을 생각하여 방부제, 화학첨가물 및 유해성분은 첨가되지 않은 안전한 상품입니다. 또한, 필수 아미노산과 글루코사민을 함유하고 있어 관절건강에 도움을 주며, 곡물을 사용하지 않아 곡물 알레르기 및 소화불량 문제에 도움을 줍니다. 상품 보관시 건조하고 서늘한곳에 보관해주시기를 바랍니다. 개봉 전 실온 보관해주시고 개봉 후에는 냉장보관 부탁드립니다. 자세한 급여량과 영양성분은 상세페이지를 참고 해주시기를 바랍니다.
