insert into product VALUES(383,'101201','건식','아카나 클래식 와일드 코스트 독 2kg',31500,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%81%B4%EB%9E%98%EC%8B%9D%20%EC%99%80%EC%9D%BC%EB%93%9C%20%EC%BD%94%EC%8A%A4%ED%8A%B8%20%EB%8F%85%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%81%B4%EB%9E%98%EC%8B%9D%20%EC%99%80%EC%9D%BC%EB%93%9C%20%EC%BD%94%EC%8A%A4%ED%8A%B8%20%EB%8F%85%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%81%B4%EB%9E%98%EC%8B%9D%20%EC%99%80%EC%9D%BC%EB%93%9C%20%EC%BD%94%EC%8A%A4%ED%8A%B8%20%EB%8F%85%202kg.jpg',"아카나 클래식 와일드 코스트 독은 고함량의 오메가 지방산과 단백질을 동시에 섭취 가능한 영양 사료로 모든 견종, 모든 연령에게 급여가 가능합니다. 차가운 북부 호수들에서 잡는 자연산 생선을 매일 신선하게 운반해 통 먹이의 비율로 사용하므로, 천연의 영양소가 가득합니다. 또한, 저탄수화물, 고단백질으로 모든 견종의 최상의 신체 상태를 유지하도록 촉진해주며 아카나는 일반 사료들과 달리 칼로리가 단백질과 지방에서 더 많이 나오고 탄수화물에서는 적게 나오므로, 비만과 당뇨병의 위험을 줄이고 반려견의 최적의 건강과 성장을 이루도록 촉진합니다. 아카나 상품은 공식 총판인 펀엔씨 인터내셔널이 수입하며, 고퀄리티 박스와 에어필름을 사용하여 안심 포장을 합니다.
