insert into product VALUES(401,'101201','건식','아카나 헤리티지 퍼피 앤 주니어 독 6kg',58500,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%97%A4%EB%A6%AC%ED%8B%B0%EC%A7%80%20%ED%8D%BC%ED%94%BC%20%EC%95%A4%20%EC%A3%BC%EB%8B%88%EC%96%B4%20%EB%8F%85%206kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%97%A4%EB%A6%AC%ED%8B%B0%EC%A7%80%20%ED%8D%BC%ED%94%BC%20%EC%95%A4%20%EC%A3%BC%EB%8B%88%EC%96%B4%20%EB%8F%85%206kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EC%95%84%EC%B9%B4%EB%82%98%20%ED%97%A4%EB%A6%AC%ED%8B%B0%EC%A7%80%20%ED%8D%BC%ED%94%BC%20%EC%95%A4%20%EC%A3%BC%EB%8B%88%EC%96%B4%20%EB%8F%85%206kg.jpg',"아카나 퍼피 앤 주니어는 짧은 기간에 빠르게 성장하는 중,대형견을 위한 맞춤 영양 사료로 성견시 체중 9~25kg, 12개월 미만의 반려견에게 급여가 가능합니다. 놓아 기른 닭의 고기, 자연산 가자미와 자연란 통 계란을 다량 사용해서 만들며,이 재료들은 신선하게 통 먹이의 비율로 우리 시설에 운반해 오므로 영양분과 풍미가 가득합니다. 쌀, 타피오카, 감자와 같은 혈당지수가 높은 탄수화물과 곡물을 사용하지 않은 아카나는 육류 단백질이 풍부하여 반려견의 최상의 신체 발달과 컨디션을 이룰 수 있도록 촉진합니다. 캐나다의 가장 좋고 가장 신선한 재료를 가지고 상을 수상한 우리 시설에서 만드는 생물학적으로 적합한 아카나가 여러분의 강아지를 건강하고 행복하고 튼튼하게 지켜준다는 것을 보증합니다.아카나는 일반 사료들과 달리 칼로리가 단백질과 지방에서 더 많이 나오고 탄수화물에서는 적게 나오므로, 비만과 당뇨병의 위험을 줄이고 여러분의 강아지가 최상의 건강과 성장을 이루도록 촉진합니다. 아카나 상품은 공식 총판인 펀엔씨 인터내셔널이 수입하며, 고퀄리티 박스와 에어필름을 사용하여 안심 포장을 합니다.
