insert into product VALUES(486,'101201','건식','웰니스 심플 그레인프리 연어 2.04kg',29500,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EC%9B%B0%EB%8B%88%EC%8A%A4%20%EC%8B%AC%ED%94%8C%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%20%EC%97%B0%EC%96%B4%202.04kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EC%9B%B0%EB%8B%88%EC%8A%A4%20%EC%8B%AC%ED%94%8C%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%20%EC%97%B0%EC%96%B4%202.04kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EC%9B%B0%EB%8B%88%EC%8A%A4%20%EC%8B%AC%ED%94%8C%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%20%EC%97%B0%EC%96%B4%202.04kg.jpg',"웰니스 심플 그레인프리 연어 & 감자 포뮬라는 음식과민증, 음식 알러지를 위한 웰니스의 제한적 원료를 사용한 사료입니다. 특히 알러지 유발율이 매우 낮은 연어만을 단일 단백질원으로 사용하여 피부질환 개선에 도움을 줍니다. 오메가-3 지방산의 함량이 매우 높으며 이외에도 살아있는 유산균으로 장 건강까지 생각 했습니다. 각종 화학 첨가제와 충진제는 함유되지 않아 안심하고 급여하실 수 있습니다.
