insert into product VALUES(531,'101201','건식','인섹트도그 하이포알러지 미니 2kg',43000,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%EC%9D%B8%EC%84%B9%ED%8A%B8%EB%8F%84%EA%B7%B8%20%ED%95%98%EC%9D%B4%ED%8F%AC%EC%95%8C%EB%9F%AC%EC%A7%80%20%EB%AF%B8%EB%8B%88%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%EC%9D%B8%EC%84%B9%ED%8A%B8%EB%8F%84%EA%B7%B8%20%ED%95%98%EC%9D%B4%ED%8F%AC%EC%95%8C%EB%9F%AC%EC%A7%80%20%EB%AF%B8%EB%8B%88%202kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%EC%9D%B8%EC%84%B9%ED%8A%B8%EB%8F%84%EA%B7%B8%20%ED%95%98%EC%9D%B4%ED%8F%AC%EC%95%8C%EB%9F%AC%EC%A7%80%20%EB%AF%B8%EB%8B%88%202kg.jpg',"인섹트도그 하이포알러지 미니는 알레르기 유발 가능성이 현저히 낮은 밀웜을 주원료로 만든 사료입니다. 향미제 대신 슈퍼푸드인 블루베리, 라즈베리, 비트, 치커리 뿌리를 함유하였으며, 독일 및 유럽지역의 계약농가에서 친환경 농법으로 재배됩니다. 풍부한 비타민과 미네랄 함유로 피부 모질 개선, 신체 에너지 생성에 도움을 주며, 소형견도 부담없이 섭취, 소화하도록 사료 알갱이 사이즈를 최적화하였습니다. 직사광선을 피하고 서늘한 곳에 보관하는 것을 권장드리며, 개봉 후에는 가급적 빠른 시일 내에 급여해주시기 바랍니다.
