insert into product VALUES(604,'101202','화식/습식','크라운롤리 닭고기 그레인프리 100g',2900,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%ED%81%AC%EB%9D%BC%EC%9A%B4%EB%A1%A4%EB%A6%AC%20%EB%8B%AD%EA%B3%A0%EA%B8%B0%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%20100g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%ED%81%AC%EB%9D%BC%EC%9A%B4%EB%A1%A4%EB%A6%AC%20%EB%8B%AD%EA%B3%A0%EA%B8%B0%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%20100g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%ED%81%AC%EB%9D%BC%EC%9A%B4%EB%A1%A4%EB%A6%AC%20%EB%8B%AD%EA%B3%A0%EA%B8%B0%20%EA%B7%B8%EB%A0%88%EC%9D%B8%ED%94%84%EB%A6%AC%20100g.jpg',"크라운롤리 닭고기 그레인프리 100g은 국내산 유기농 원물을 중점으로 사용한 화식,습식사료입니다. 피부 건강에 도움을 주는 풍부한 콜라겐 성분이 들어있는 닭고기를 함유하였으며, 식이섬유가 풍부해 소화기간에 도움을 주는 고구마가 함유되었습니다. 또한, ISO 품질경영시스템 인증을 받은 국내 제조시설에서 생산되고있어 안심하고 급여가 가능하며, 조리없이 간편하게 바로 급여가 가능합니다. 상품 보관시 직사광선 및 해충이 있는 곳을 피하고, 서늘하고 건조한 곳에 보관하여 주시기를 바랍니다.
