insert into product VALUES(631,'101201','건식','펫가드 보양대첩 워밍 연어와 강황 1.8kg',24800,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/%ED%8E%AB%EA%B0%80%EB%93%9C%20%EB%B3%B4%EC%96%91%EB%8C%80%EC%B2%A9%20%EC%9B%8C%EB%B0%8D%20%EC%97%B0%EC%96%B4%EC%99%80%20%EA%B0%95%ED%99%A9%201.8kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/%ED%8E%AB%EA%B0%80%EB%93%9C%20%EB%B3%B4%EC%96%91%EB%8C%80%EC%B2%A9%20%EC%9B%8C%EB%B0%8D%20%EC%97%B0%EC%96%B4%EC%99%80%20%EA%B0%95%ED%99%A9%201.8kg.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/%ED%8E%AB%EA%B0%80%EB%93%9C%20%EB%B3%B4%EC%96%91%EB%8C%80%EC%B2%A9%20%EC%9B%8C%EB%B0%8D%20%EC%97%B0%EC%96%B4%EC%99%80%20%EA%B0%95%ED%99%A9%201.8kg.jpg',"펫가드 보양대첩 워밍 연어와 강황 1.8kg은 체질 맞춤 푸드테라피 가수분해 저알러지 사료입니다. 따뜻한 곳을 좋아하고 원기 회복이 필요한 반려견에게 도움을 주는 보양식으로 특성 맞춤 원료를 사용하였으며, 커큐민이 풍부한 원료로 항산화와 순환, 소화에 도움을 주는 강황을 함유하였습니다. 또한, AAFCO(미국사료협회)와 NRC(국립연구위원회) 등 국내외 인증과 검증을 받았으며, HACCP 식품안전관리 인증받은 제조시설에서 생산되고있어 안심하고 급여가 가능합니다. 상품 보관시 직사광선 및 해충이 있는 곳을 피하고, 서늘하고 건조한 곳에 보관하여 주시기를 바랍니다.
