insert into product VALUES(779,'101203','에어/동결','iti 도그 비티 소고기&장어 200g',14000,'https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img_resize/iti%20%EB%8F%84%EA%B7%B8%20%EB%B9%84%ED%8B%B0%20%EC%86%8C%EA%B3%A0%EA%B8%B0%EC%9E%A5%EC%96%B4%20200g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_img/iti%20%EB%8F%84%EA%B7%B8%20%EB%B9%84%ED%8B%B0%20%EC%86%8C%EA%B3%A0%EA%B8%B0%EC%9E%A5%EC%96%B4%20200g.jpg','https://cocobob-storage.s3.ap-northeast-2.amazonaws.com/product_detail/iti%20%EB%8F%84%EA%B7%B8%20%EB%B9%84%ED%8B%B0%20%EC%86%8C%EA%B3%A0%EA%B8%B0%EC%9E%A5%EC%96%B4%20200g.jpg',"iti 도그 비티 소고기&장어는 90%생고기를 자연 건조시킨 사료입니다. 소고기와 장어가 함유되어 있어 신진대사 촉진을 원할하게 하는데 도움을 주며, 눈 건강과 위장 건강에 도움을 줄 수 있습니다. ITI는 뉴질랜드 청정지역의 생고기를 사용하였으며, 뜨거운 공기를 이용해 수분을 말린 자연 건조한 상품으로 개봉 후 10일 이내 급여를 권장합니다. 주식 이외에 보상용 간식, 기존 급여하던 사료 위의 토핑으로 급여할 수 있습니다. 직사광선을 피해 건조하고 서늘한 곳에 급여하며, 하단 상세페이지의 일일 권장급여량을 참고해주시기 바랍니다.
